//näyttää yhden maan tiedot

const Maalista = ({ maa }) => {
  return (
    <div>
      <ul>
        <li key={maa.name.official}>
          {maa.name.official}
          <button onClick={function (event) {
              <Maa maa={maa} />
          }}>Näytä</button>
        </li>
      </ul>
    </div>
  )
}

export default Maalista
